import React, { useEffect, useState, Component } from "react";
import classes from "../styles/HeaderBurger.module.css";
import NavigationBurger from "../components/NavigationBurger";
import Footer from "../components/Footer";
import ProductItems from "../components/ProductItems";
import axios from "axios";
import { useDispatch, useSelector } from "react-redux";
import Navigation from "../components/Navigation";
import logoWhite from "../img/logoW.png";
import IconBurger from "../img/x.png";
import { activeBorgerAction } from "../store/Burger";

function Brand() {
  const dispatch = useDispatch();
  const activeBurger = () => {
    dispatch(activeBorgerAction(true));
  };
  return (
    <div className={classes.Jewelry}>
      <Navigation
        icon={logoWhite}
        iconBurger={IconBurger}
        func={activeBurger}
      ></Navigation>
      <p style={{ borderTop: "2px solid #fff", margin: "30px 162px" }}></p>
      <div style={{ marginTop: "500px" }}></div>
      <Footer></Footer>
    </div>
  );
}

export default Brand;
